INSERT INTO `sp_faqs` (`id`, `ids`, `name`, `slug`, `content`, `position`, `status`, `updated_at`, `created_at`) VALUES
(1, '63db969dafbb30b70ad453a61de2a122', 'Refund policy', 'refund-policy', '<p>Every now and then, a good thing must come to an end. You might experience a change with your social channels, perhaps you&#39;re taking a break from social media, or maybe it&#39;s just time to move on from Postbea. While it&#39;s sad when that time comes, we want to do the best we can for you. You&#39;re free to cancel your subscription at any point in your journey.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you&#39;re cancelling an annual subscription, you&#39;ll receive a prorated refund with active time being charged at the normal monthly rate. Refunds will always be returned to the original card used to make the payment--we are unable to send refunds to any other payment method.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The processing usually takes between 5-10 business days, and if the refund is made before the charge is authorized by your bank, it will be sent back as a reversal instead. This means the charge will drop off your bank statement or the original charge will be adjusted to reflect the refund.</p>', 1, 0, '2022-02-16 15:11:32', '2021-07-27 07:42:17'),
(2, 'a8a88e2d778a9cfc040b959b9b9d4686', 'Cancelling your subscription or deleting your account', 'cancelling-your-subscription-or-deleting-your-account', '<p>Only the account owner is able to access billing pages or delete accounts. Please keep in mind that this is permanent and will delete all accounts associated to this email address. If you are subscribed to Publish, Analyze, or both, all of those subscriptions will be cancelled and your accounts will be deleted. Any posts you have published to your social media accounts through Publish will remain in place.</p>', 2, 1, '2022-02-16 15:24:03', '2021-07-27 07:47:52'),
(3, '786a842a6949516bbdfb52b18163baac', 'Pause your Postbea subscription', 'pause-your-postbea-subscription', '&lt;p&gt;Take the time you need for your most pressing business costs. We&amp;rsquo;re offering paused subscriptions for anyone in need. Your Buffer posts and settings stay secure until you return&lt;/p&gt;', 3, 1, '2021-07-27 09:25:38', '2021-07-27 07:53:05'),
(4, 'df04cc341b398f4efa0480382f1696e3', 'Downgrading to Free plan', 'downgrading-to-free-plan', '&lt;p&gt;Your Postbea account may be downgraded to the Free plan under the following circumstances:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;You explicitly choose to downgrade from a paid plan to the Free plan.&lt;/li&gt;\r\n	&lt;li&gt;You&amp;#39;ve been on a free trial of the Pro, Premium, or Business plan and you don&amp;#39;t upgrade at the end of the trial.&lt;/li&gt;\r\n	&lt;li&gt;You&amp;#39;re on a paid plan but the credit card associated with your account expires, or a payment fails. In this case, we&amp;rsquo;ll send an email notice of that payment failure immediately, and we&amp;rsquo;ll retry processing the payment three times over a two-week period. If the payment doesn&amp;rsquo;t succeed after those attempts, the account will automatically downgrade to the Free plan.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;When your account is downgraded to the Free plan, you will then be within the limits of that plan. On the Free Plan, you&amp;#39;re able to connect up to three social channels If your account has additional users at the time of downgrading, those users will also be locked from accessing any social channels you&amp;#39;d invited them to, since additional users are not supported on the Free plan.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;If you have more than three channels connected at the time of downgrading, the surplus channels will be locked. Locked channels remain connected to your account but are not usable. If you upgrade to a paid plan in the future, with space for the surplus channels, they will automatically unlock&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', 4, 1, '2021-07-27 08:02:13', '2021-07-27 08:01:26'),
(5, 'cd9145fe7277298984abb0f3bcb6a543', 'How do I get a free trial?', 'how-do-i-get-a-free-trial', 'You can get a 14 days free trial with full access to our Accelerate platform. You can connect up to 10 social profiles and test out all of our features, with the exception of our Concierge Services. \r\nTo get it, just create a new account here: https://www.postbea.com', 5, 1, '2021-07-27 08:41:35', '2021-07-27 08:41:35'),
(6, '4c3530ecd297a1de8aeb1eba496f6f3b', 'Asking For support', 'asking-for-support', 'If you ever have any issues with our platform, the easiest way to get help is by SENDING US AN EMAIL. This way, you will reach our Support team directly with all the information that we need in order to successfully troubleshoot the issue you&#039;re having right now.\r\nWhat Information Should I Send?\r\nAccording to your type of problem, we might require different kinds of information but, as a rule of thumb here is some of the information we might need to help:\r\n•	The type of problem you&#039;re having (Adding a post, publishing something, connecting a profile, finding something, etc.).\r\n•	The type of profile affected and the name (e.g., Postbea, Facebook Page, Twitter etc);\r\n•	The category in which this is happening (only if applicable).\r\n•	The workspace in which this is happening (only if applicable).\r\n•	Full-page screenshots of the steps you took when this happened. If possible\r\n•	A screen recording of the issue.\r\n•	As many details as you can remember because anything might be helpful.', 6, 1, '2021-07-27 09:24:30', '2021-07-27 09:24:30');
