(2435, '6141e3ba05582b04f1b77b66dae228d4', 'fr', 'c686dffe09b13701a4cc47577d2bec89', 'Format : HH:MM. Par exemple, si vous le définissez sur <b>01:00</b>, votre activité s\'arrêtera automatiquement après une heure. Si vous le laissez vide, l\'activité fonctionnera à l\'infini ou alors que les limites d\'Instagram pour votre compte ne seront pas atteintes.'),
