(2441, 'a8ef2a2bbe575384fcbdb26b69ea242a', 'fr', 'f83f5f7ce557b10712eb03a544f30898', 'En fonction des actions d\'activité sélectionnées, vous pouvez aimer et/ou commenter les médias publiés sous <b>Tags</b> ajoutés dans vos paramètres, et/ou suivre les utilisateurs qui ont publié ces médias.<br/><br/ > <span class=\'text-info\'>INFO :</span> Cette source de ciblage fonctionne indépendamment de toutes les autres sources de ciblage que vous pouvez sélectionner.<br/><br/> <span class=\'text-warning\'> IMPORTANT :</span> Pour utiliser cette source, vous devez ajouter au moins 1 tags dans la liste <b>Tags</b>.'),
(2442, '4eb394998ddf24819fb964dafbc8137d', 'fr', 'b0ac8d80b81d5b7502dd764beb3efc16', 'En fonction des actions d\'activité sélectionnées, vous pouvez aimer et/ou commenter les médias publiés sous <b>Lieux</b> ajoutés dans vos paramètres, et/ou suivre les utilisateurs qui ont publié ces médias.<br/><br/ > <span class=\'text-info\'>INFO :</span> Cette source de ciblage fonctionne indépendamment de toutes les autres sources de ciblage que vous pouvez sélectionner.<br/><br/> <span class=\'text-warning\'> IMPORTANT :</span> Pour utiliser cette source, vous devez ajouter au moins 1 emplacement dans la liste <b>Emplacements</b>.'),
(2443, '5db922e509003bee259936f35e131fc1', 'fr', '49084dc4dfc5b065676e8aa3281df751', 'En fonction des actions d\'activité sélectionnées, vous pouvez suivre les utilisateurs qui suivent les <b>noms d\'utilisateur</b> ajoutés dans vos paramètres (abonnés des noms d\'utilisateur), et/ou aimer ou commenter 1 à 3 médias les plus récents publiés par ces utilisateurs .<br/> Vous pouvez également cibler vos propres abonnés (utilisateurs qui suivent votre compte) en sélectionnant <b>Mon compte</b> ou <b>Tous</b>.<br/><br/> <span class=\'text-info\'>INFO :</span> Cette source de ciblage fonctionne indépendamment de toutes les autres sources de ciblage que vous pouvez sélectionner.<br/><br/> <span class=\'text-warning\'>IMPORTANT :< /span> Pour utiliser cette source, vous devrez peut-être ajouter au moins 2 noms d\'utilisateur dans la liste <b>Noms d\'utilisateur</b>.');
