(2445, 'f37c5bd4d71011809fcb5bf3036c0682', 'fr', '6b3407b1e3505b0fd4a3ff8a69fca721', 'En fonction des actions d\'activité sélectionnées, vous pouvez suivre les utilisateurs suivis des <b>noms d\'utilisateur</b> ajoutés dans vos paramètres (suivi des noms d\'utilisateur), et/ou aimer ou commenter 1 à 3 médias les plus récents publiés par ces utilisateurs .<br/> Vous pouvez également cibler vos propres abonnés (utilisateurs que vous suivez) en sélectionnant <b>Mon flux</b> ou <b>Tous</b>.<br/><br/> <span class= \'text-info\'>INFO :</span> Cette source de ciblage fonctionne indépendamment de toutes les autres sources de ciblage que vous pouvez sélectionner.<br/><br/> <span class=\'text-warning\'>IMPORTANT :</span > Pour utiliser cette source, vous devrez peut-être ajouter au moins 2 noms d\'utilisateur dans la liste <b>Noms d\'utilisateur</b>.'),
