(2452, '9f3d065b6161a1b63521ef1c17570f19', 'fr', 'e71b4bf4aa9f3046a2ee72767734d374', 'Activez ce commutateur pour automatiser votre activité favorite.<br/><br/> Le compteur indique le nombre de médias que vous avez mis en favori depuis le début de votre dernière activité.'),
