(2454, '6501514f69bafc12714c82270c59d5ef', 'fr', '50bd2d93fcbd272e92047e39bede61ec', 'Activez ce commutateur pour automatiser votre activité de retweets.<br/><br/> Le compteur indique le nombre de tweets que vous avez retweetés depuis le début de votre dernière activité.'),
(2455, '154e7c9feee302c70e4b419082f7875f', 'fr', 'c6996960a60821b9748062d0e8c48ffd', 'Activez ce commutateur pour automatiser votre activité de visionnage d\'histoires.'),
