(2457, '5a433191dbf4248faf04ab893a033092', 'fr', '7d693bf9e58943aabbbaeafc1201a01b', 'Activez ce commutateur pour automatiser votre activité de désabonnement.<br/><br/> Le compteur indique le nombre d\'utilisateurs dont vous vous êtes désabonné depuis le début de votre dernière activité.'),
(2458, '4e813836150fe7c2efc669da4b9b1bca', 'fr', '08e12a47c67500a7bbb1cbafdfba9b2e', 'Activez ce commutateur pour automatiser votre activité de messages privés.<br/><br/> Le compteur indique le nombre d\'utilisateurs que vous avez envoyés par message privé depuis le début de votre dernière activité.'),
(2459, 'a20d7f661afed85c181af783b110371d', 'fr', '6236091f4e8e657aad7f57f31235a6d3', 'Activez ce commutateur pour automatiser votre activité de republiage des médias.<br/><br/> Le compteur indique le nombre de médias que vous avez publiés depuis le début de votre dernière activité.'),
