(2463, '1ea57d29ad365223d18286286255abd7', 'fr', '4975839e87843d3277cf36b14bb26756', 'Quels utilisateurs ne plus suivre ?<br/><br/><b>Notre source</b> — sélectionnez cette option si vous souhaitez ne plus suivre que les utilisateurs qui ont été suivis par notre service.<br/>Cette option devrait être utilisé dans la plupart des cas, en particulier si vous utilisez les actions Suivre et Ne plus suivre en même temps.<br/><br/><b>Tous</b> : sélectionnez cette option si vous souhaitez vous désabonner de tous les utilisateurs que vous suivez.'),
(2464, '44381e7ed4303b9ba85c2d139779b0e2', 'fr', '0ffc10a2be2ec21a781e393ed9adcd3f', 'Notre source'),
(2465, '76a66867efffdb37ad303465ba9ff59a', 'fr', 'dbeb4495bcc6c50b8c2d7e6229bd74e7', 'Le système commencera à ne plus suivre les utilisateurs après 3/5/7 jours après l\'action de suivi.<br/><br/><span class=\'text-info\'>REMARQUE :</span> Il suffit de prendre en charge le désabonnement par notre source'),
(2466, '3b330ab8e78a809409b74908cab13678', 'fr', 'a1ece9b329031f775f64bcb33efaa77e', 'En cochant cette case, vous ne vous désabonnerez pas des utilisateurs qui vous suivent.<br><br><span class=\'warning\'>AVERTISSEMENT :</span> Si vous utilisez ce paramètre, veuillez vous attendre à ce que votre activité de désabonnement puisse être bloqué à zéro pendant un certain temps. Notre service peut prendre un certain temps pour trouver les utilisateurs qui ne vous suivent pas, et cela dépend du nombre d\'utilisateurs que vous suivez et de la source de désabonnement sélectionnée.'),
