(5240, 'a806d26425e7078bd7d53236ed1576b6', 'es', 'b5abdb2d2730922eae9da8bb94e1421d', 'En función de las Acciones de actividad seleccionadas, puede dar me gusta y / o comentar los medios publicados en <b> Palabras clave </b> agregadas en su configuración, y / o seguir a los usuarios que publicaron esos medios. <br/> <br / > <span class = \'text-info\'> INFO: </span> Esta fuente de orientación funciona independientemente de todas las demás fuentes de orientación que puede seleccionar. <br/> <br/> <span class = \'text-warning\'> IMPORTANTE: </span> Para utilizar esta fuente, debe agregar al menos 1 palabra clave en la lista <b> Palabras clave </b>.'),
(5241, '242dc2d469c6ed2d8db315d7ed44bef1', 'es', '8445591f27349af088f388dfed50170d', 'Según las Acciones de actividad seleccionadas, puede seguir a los usuarios a los que les haya gustado los medios publicados por los <b> Nombres de usuario </b> agregados en su configuración, y / o me gusta o comentar en 1-3 medios más recientes publicados por esos usuarios. <br/> También puede orientar sus anuncios a sus propios Me gusta (usuarios a los que les han gustado sus medios) seleccionando <b> Mis publicaciones </b> o <b> Todas </b>. <br/> <br/> <span class = \'text-info\'> INFO: </span> Esta fuente de orientación funciona independientemente de todas las demás fuentes de orientación que puede seleccionar. <br/> <br/> <span class = \'text-warning\'> IMPORTANTE : </span> Para utilizar esta fuente, es posible que deba agregar al menos 2 nombres de usuario en la lista <b> Nombres de usuario </b>.'),
