(5243, '03ca789584044d84cf45dd597c67e570', 'es', '84ab6f279e000706c683f1837fc059e1', 'Número de acciones de respuesta que su actividad intentará publicar en una hora. <br/> <br/> Valores permitidos: <b> 1 </b> - <b> 20 </b> <br/> <br/> <span class = \'text-danger\'> ¡Úselo con precaución! </span>'),
