(5248, '559beded5bb8c318fe1388655d877edd', 'es', 'e46d28e4c1ddd830342c5d0be6806790', 'Formato: HH:MM. Por ejemplo, si lo configura en <b> 01:00 </b>, su actividad se detendrá automáticamente después de una hora. Si lo deja en blanco, la actividad funcionará infinitamente o mientras no se alcancen los límites de Twitter para su cuenta.'),
