(44, 'email_activation_content', '<p>Welcome to {website_name}!<br />\r\n<br />\r\nHello {full_name},<br />\r\n<br />\r\nThank you for joining! We&#39;re glad to have you as community member, and we&#39;re stocked for you to start exploring our service.<br />\r\nAll you need to do is activate your account:<br />\r\n{activation_link}<br />\r\n<br />\r\nThanks and Best Regards!</p>', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(45, 'email_welcome_subject', 'Hi {full_name}! Getting Started with Our Service', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(46, 'email_welcome_content', '<p>Hello {full_name}!<br />\r\n<br />\r\nCongratulations!<br />\r\n<br />\r\nYou have successfully signed up for our service.<br />\r\nYou have got a trial package, starting today.<br />\r\nWe hope you enjoy this package! We love to hear from you,<br />\r\n<br />\r\nThanks and Best Regards!</p>', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(47, 'email_forgot_password_subject', 'Hi {full_name}! Password Reset', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(48, 'email_forgot_password_content', '<p>Hi {full_name}!<br />\r\n<br />\r\nSomebody (hopefully you) requested a new password for your account.<br />\r\nNo changes have been made to your account yet.<br />\r\n<br />\r\nYou can reset your password by click this link:<br />\r\n{recovery_password_link}.<br />\r\n<br />\r\nIf you did not request a password reset, no further action is required.<br />\r\n<br />\r\nThanks and Best Regards!</p>', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(49, 'email_renewal_reminders_subject', 'Hi {full_name}, Here\'s a little Reminder your Membership is expiring soon...', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(50, 'email_renewal_reminders_content', '<p>Dear {full_name},<br />\r\n<br />\r\nYour membership with your current package will expire in {days_left} days.<br />\r\n<br />\r\nWe hope that you will take the time to renew your membership and remain part of our community. It couldn&#39;t be easier - just click here to renew: {pricing_page}<br />\r\n<br />\r\nThanks and Best Regards!</p>', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(51, 'email_payment_subject', 'Hi {full_name}, Thank you for your payment', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
(52, 'email_payment_content', '<p>Hi {full_name},<br />\r\n<br />\r\nYou just completed the payment successfully on our service.<br />\r\nThank you for being awesome, we hope you enjoy your package.<br />\r\n<br />\r\nThanks and Best Regards!</p>', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
