(60, 'terms_of_services', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;TERMS AND CONDITIONS&lt;br /&gt;\r\nLast updated: 2021-06-08&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Introduction&lt;/p&gt;\r\n\r\n&lt;p&gt;Welcome to VoyagerGalactic LLC (&amp;ldquo;Company&amp;rdquo;, &amp;ldquo;we&amp;rdquo;, &amp;ldquo;our&amp;rdquo;, &amp;ldquo;us&amp;rdquo;)!&lt;/p&gt;\r\n\r\n&lt;p&gt;These Terms of Service (&amp;ldquo;Terms&amp;rdquo;, &amp;ldquo;Terms of Service&amp;rdquo;) govern your use of our website located at voyagergalactic.com (together or individually &amp;ldquo;Service&amp;rdquo;) operated by VoyagerGalactic LLC.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Privacy Policy also governs your use of our Service and explains how we collect, safeguard and disclose information that results from your use of our web pages.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your agreement with us includes these Terms and our Privacy Policy (&amp;ldquo;Agreements&amp;rdquo;). You acknowledge that you have read and understood Agreements, and agree to be bound of them.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you do not agree with (or cannot comply with) Agreements, then you may not use the Service, but please let us know by emailing at admin@voyagergalactic.com so we can try to find a solution. These Terms apply to all visitors, users and others who wish to access or use Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Communications&lt;/p&gt;\r\n\r\n&lt;p&gt;By using our Service, you agree to subscribe to newsletters, marketing or promotional materials and other information we may send. However, you may opt out of receiving any, or all, of these communications from us by following the unsubscribe link or by emailing at admin@voyagergalactic.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Purchases&lt;/p&gt;\r\n\r\n&lt;p&gt;If you wish to purchase any product or service made available through Service (&amp;ldquo;Purchase&amp;rdquo;), you may be asked to supply certain information relevant to your Purchase including but not limited to, your credit or debit card number, the expiration date of your card, your billing address, and your shipping information.&lt;/p&gt;\r\n\r\n&lt;p&gt;You represent and warrant that: (i) you have the legal right to use any card(s) or other payment method(s) in connection with any Purchase; and that (ii) the information you supply to us is true, correct and complete.&lt;/p&gt;\r\n\r\n&lt;p&gt;We may employ the use of third party services for the purpose of facilitating payment and the completion of Purchases. By submitting your information, you grant us the right to provide the information to these third parties subject to our Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;We reserve the right to refuse or cancel your order at any time for reasons including but not limited to: product or service availability, errors in the description or price of the product or service, error in your order or other reasons.&lt;/p&gt;\r\n\r\n&lt;p&gt;We reserve the right to refuse or cancel your order if fraud or an unauthorized or illegal transaction is suspected.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Contests, Sweepstakes and Promotions&lt;/p&gt;\r\n\r\n&lt;p&gt;Any contests, sweepstakes or other promotions (collectively, &amp;ldquo;Promotions&amp;rdquo;) made available through Service may be governed by rules that are separate from these Terms of Service. If you participate in any Promotions, please review the applicable rules as well as our Privacy Policy. If the rules for a Promotion conflict with these Terms of Service, Promotion rules will apply.&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Subscriptions&lt;/p&gt;\r\n\r\n&lt;p&gt;Some parts of Service are billed on a subscription basis (&amp;quot;Subscription(s)&amp;quot;). You will be billed in advance on a recurring and periodic basis (&amp;quot;Billing Cycle&amp;quot;). Billing cycles will be set depending on the type of subscription plan you select when purchasing a Subscription.&lt;/p&gt;\r\n\r\n&lt;p&gt;At the end of each Billing Cycle, your Subscription will automatically renew under the exact same conditions unless you cancel it or VoyagerGalactic LLC cancels it. You may cancel your Subscription renewal either through your online account management page or by contacting admin@voyagergalactic.com customer support team.&lt;/p&gt;\r\n\r\n&lt;p&gt;A valid payment method is required to process the payment for your subscription. You shall provide VoyagerGalactic LLC with accurate and complete billing information that may include but not limited to full name, address, state, postal or zip code, telephone number, and a valid payment method information. By submitting such payment information, you automatically authorize VoyagerGalactic LLC to charge all Subscription fees incurred through your account to any such payment instruments.&lt;/p&gt;\r\n\r\n&lt;p&gt;Should automatic billing fail to occur for any reason, VoyagerGalactic LLC reserves the right to terminate your access to the Service with immediate effect.&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Free Trial&lt;/p&gt;\r\n\r\n&lt;p&gt;VoyagerGalactic LLC may, at its sole discretion, offer a Subscription with a free trial for a limited period of time (&amp;quot;Free Trial&amp;quot;).&lt;/p&gt;\r\n\r\n&lt;p&gt;You may be required to enter your billing information in order to sign up for Free Trial.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you do enter your billing information when signing up for Free Trial, you will not be charged by VoyagerGalactic LLC until Free Trial has expired. On the last day of Free Trial period, unless you cancelled your Subscription, you will be automatically charged the applicable Subscription fees for the type of Subscription you have selected.&lt;/p&gt;\r\n\r\n&lt;p&gt;At any time and without notice, VoyagerGalactic LLC reserves the right to (i) modify Terms of Service of Free Trial offer, or (ii) cancel such Free Trial offer.&lt;/p&gt;\r\n\r\n&lt;p&gt;7. Fee Changes&lt;/p&gt;\r\n\r\n&lt;p&gt;VoyagerGalactic LLC, in its sole discretion and at any time, may modify Subscription fees for the Subscriptions. Any Subscription fee change will become effective at the end of the then-current Billing Cycle.&lt;/p&gt;\r\n\r\n&lt;p&gt;VoyagerGalactic LLC will provide you with a reasonable prior notice of any change in Subscription fees to give you an opportunity to terminate your Subscription before such change becomes effective.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your continued use of Service after Subscription fee change comes into effect constitutes your agreement to pay the modified Subscription fee amount.&lt;/p&gt;\r\n\r\n&lt;p&gt;8. Refunds&lt;/p&gt;\r\n\r\n&lt;p&gt;We issue refunds for Contracts within 1 days of the original purchase of the Contract.&lt;/p&gt;\r\n\r\n&lt;p&gt;9. Content&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Service allows you to post, link, store, share and otherwise make available certain information, text, graphics, videos, or other material (&amp;ldquo;Content&amp;rdquo;). You are responsible for Content that you post on or through Service, including its legality, reliability, and appropriateness.&lt;/p&gt;\r\n\r\n&lt;p&gt;By posting Content on or through Service, You represent and warrant that: (i) Content is yours (you own it) and/or you have the right to use it and the right to grant us the rights and license as provided in these Terms, and (ii) that the posting of your Content on or through Service does not violate the privacy rights, publicity rights, copyrights, contract rights or any other rights of any person or entity. We reserve the right to terminate the account of anyone found to be infringing on a copyright.&lt;/p&gt;\r\n\r\n&lt;p&gt;You retain any and all of your rights to any Content you submit, post or display on or through Service and you are responsible for protecting those rights. We take no responsibility and assume no liability for Content you or any third party posts on or through Service. However, by posting Content using Service you grant us the right and license to use, modify, publicly perform, publicly display, reproduce, and distribute such Content on and through Service. You agree that this license includes the right for us to make your Content available to other users of Service, who may also use your Content subject to these Terms.&lt;/p&gt;\r\n\r\n&lt;p&gt;VoyagerGalactic LLC has the right but not the obligation to monitor and edit all Content provided by users.&lt;/p&gt;\r\n\r\n&lt;p&gt;In addition, Content found on or through this Service are the property of VoyagerGalactic LLC or used with permission. You may not distribute, modify, transmit, reuse, download, repost, copy, or use said Content, whether in whole or in part, for commercial purposes or for personal gain, without express advance written permission from us.&lt;/p&gt;\r\n\r\n&lt;p&gt;10. Prohibited Uses&lt;/p&gt;\r\n\r\n&lt;p&gt;You may use Service only for lawful purposes and in accordance with Terms. You agree not to use Service:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. In any way that violates any applicable national or international law or regulation.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. For the purpose of exploiting, harming, or attempting to exploit or harm minors in any way by exposing them to inappropriate content or otherwise.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. To transmit, or procure the sending of, any advertising or promotional material, including any &amp;ldquo;junk mail&amp;rdquo;, &amp;ldquo;chain letter,&amp;rdquo; &amp;ldquo;spam,&amp;rdquo; or any other similar solicitation.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.4. To impersonate or attempt to impersonate Company, a Company employee, another user, or any other person or entity.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.5. In any way that infringes upon the rights of others, or in any way is illegal, threatening, fraudulent, or harmful, or in connection with any unlawful, illegal, fraudulent, or harmful purpose or activity.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.6. To engage in any other conduct that restricts or inhibits anyone&amp;rsquo;s use or enjoyment of Service, or which, as determined by us, may