 the full authority, right, and capacity to enter into this agreement and abide by all of the terms and conditions of Terms. If you are not at least eighteen (18) years old, you are prohibited from both the access and usage of Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;13. Accounts&lt;/p&gt;\r\n\r\n&lt;p&gt;When you create an account with us, you guarantee that you are above the age of 18, and that the information you provide us is accurate, complete, and current at all times. Inaccurate, incomplete, or obsolete information may result in the immediate termination of your account on Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;You are responsible for maintaining the confidentiality of your account and password, including but not limited to the restriction of access to your computer and/or account. You agree to accept responsibility for any and all activities or actions that occur under your account and/or password, whether your password is with our Service or a third-party service. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.&lt;/p&gt;\r\n\r\n&lt;p&gt;You may not use as a username the name of another person or entity or that is not lawfully available for use, a name or trademark that is subject to any rights of another person or entity other than you, without appropriate authorization. You may not use as a username any name that is offensive, vulgar or obscene.&lt;/p&gt;\r\n\r\n&lt;p&gt;We reserve the right to refuse service, terminate accounts, remove or edit content, or cancel orders in our sole discretion.&lt;/p&gt;\r\n\r\n&lt;p&gt;14. Intellectual Property&lt;/p&gt;\r\n\r\n&lt;p&gt;Service and its original content (excluding Content provided by users), features and functionality are and will remain the exclusive property of VoyagerGalactic LLC and its licensors. Service is protected by copyright, trademark, and other laws of and foreign countries. Our trademarks may not be used in connection with any product or service without the prior written consent of VoyagerGalactic LLC.&lt;/p&gt;\r\n\r\n&lt;p&gt;15. Copyright Policy&lt;/p&gt;\r\n\r\n&lt;p&gt;We respect the intellectual property rights of others. It is our policy to respond to any claim that Content posted on Service infringes on the copyright or other intellectual property rights (&amp;ldquo;Infringement&amp;rdquo;) of any person or entity.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you are a copyright owner, or authorized on behalf of one, and you believe that the copyrighted work has been copied in a way that constitutes copyright infringement, please submit your claim via email to admin@voyagergalactic.com, with the subject line: &amp;ldquo;Copyright Infringement&amp;rdquo; and include in your claim a detailed description of the alleged Infringement as detailed below, under &amp;ldquo;DMCA Notice and Procedure for Copyright Infringement Claims&amp;rdquo;&lt;/p&gt;\r\n\r\n&lt;p&gt;You may be held accountable for damages (including costs and attorneys&amp;rsquo; fees) for misrepresentation or bad-faith claims on the infringement of any Content found on and/or through Service on your copyright.&lt;/p&gt;\r\n\r\n&lt;p&gt;16. DMCA Notice and Procedure for Copyright Infringement Claims&lt;/p&gt;\r\n\r\n&lt;p&gt;You may submit a notification pursuant to the Digital Millennium Copyright Act (DMCA) by providing our Copyright Agent with the following information in writing (see 17 U.S.C 512(c)(3) for further detail):&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. an electronic or physical signature of the person authorized to act on behalf of the owner of the copyright&amp;rsquo;s interest;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. a description of the copyrighted work that you claim has been infringed, including the URL (i.e., web page address) of the location where the copyrighted work exists or a copy of the copyrighted work;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. identification of the URL or other specific location on Service where the material that you claim is infringing is located;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.4. your address, telephone number, and email address;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.5. a statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, its agent, or the law;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.6. a statement by you, made under penalty of perjury, that the above information in your notice is accurate and that you are the copyright owner or authorized to act on the copyright owner&amp;rsquo;s behalf.&lt;/p&gt;\r\n\r\n&lt;p&gt;You can contact our Copyright Agent via email at admin@voyagergalactic.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;17. Error Reporting and Feedback&lt;/p&gt;\r\n\r\n&lt;p&gt;You may provide us either directly at admin@voyagergalactic.com or via third party sites and tools with information and feedback concerning errors, suggestions for improvements, ideas, problems, complaints, and other matters related to our Service (&amp;ldquo;Feedback&amp;rdquo;). You acknowledge and agree that: (i) you shall not retain, acquire or assert any intellectual property right or other right, title or interest in or to the Feedback; (ii) Company may have development ideas similar to the Feedback; (iii) Feedback does not contain confidential information or proprietary information from you or any third party; and (iv) Company is not under any obligation of confidentiality with respect to the Feedback. In the event the transfer of the ownership to the Feedback is not possible due to applicable mandatory laws, you grant Company and its affiliates an exclusive, transferable, irrevocable, free-of-charge, sub-licensable, unlimited and perpetual right to use (including copy, modify, create derivative works, publish, distribute and commercialize) Feedback in any manner and for any purpose.&lt;/p&gt;\r\n\r\n&lt;p&gt;18. Links To Other Web Sites&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Service may contain links to third party web sites or services that are not owned or controlled by VoyagerGalactic LLC.&lt;/p&gt;\r\n\r\n&lt;p&gt;VoyagerGalactic LLC has no control over, and assumes no responsibility for the content, privacy policies, or practices of any third party web sites or services. We do not warrant the offerings of any of these entities/individuals or their websites.&lt;/p&gt;\r\n\r\n&lt;p&gt;For example, the outlined Terms of Use have been created using PolicyMaker.io, a free web application for generating high-quality legal documents. PolicyMaker&amp;rsquo;s Terms and Conditions generator is an easy-to-use free tool for creating an excellent standard Terms of Service template for a website, blog, e-commerce store or app.&lt;/p&gt;\r\n\r\n&lt;p&gt;YOU ACKNOWLEDGE AND AGREE THAT COMPANY SHALL NOT BE RESPONSIBLE OR LIABLE, DIRECTLY OR INDIRECTLY, FOR ANY DAMAGE OR LOSS CAUSED OR ALLEGED TO BE CAUSED BY OR IN CONNECTION WITH USE OF OR RELIANCE ON ANY SUCH CONTENT, GOODS OR SERVICES AVAILABLE ON OR THROUGH ANY SUCH THIRD PARTY WEB SITES OR SERVICES.&lt;/p&gt;\r\n\r\n&lt;p&gt;WE STRONGLY ADVISE YOU TO READ THE TERMS OF SERVICE AND PRIVACY POLICIES OF ANY THIRD PARTY WEB SITES OR SERVICES THAT YOU VISIT.&lt;/p&gt;\r\n\r\n&lt;p&gt;19. Disclaimer Of Warranty&lt;/p&gt;\r\n\r\n&lt;p&gt;THESE SERVICES ARE PROVIDED BY COMPANY ON AN &amp;ldquo;AS IS&amp;rdquo; AND &amp;ldquo;AS AVAILABLE&amp;rdquo; BASIS. COMPANY MAKES NO REPRESENTATIONS OR WARRANTIES OF ANY KIND, EXPRESS OR IMPLIED, AS TO THE OPERATION OF THEIR SERVICES, OR THE INFORMATION, CONTENT OR MATERIALS INCLUDED THEREIN. YOU EXPRESSLY AGREE THAT YOUR USE OF THESE SERVICES, THEIR CONTENT, AND ANY SERVICES OR ITEMS OBTAINED FROM US IS AT YOUR SOLE RISK.&lt;/p&gt;\r\n\r\n&lt;p&gt;NEITHER COMPANY NOR ANY PERSON ASSOCIATED WITH COMPANY MAKES ANY WARRANTY OR REPRESENTATION WITH RESPECT TO THE COMPLETENESS, SECURITY, RELIABILITY, QUALITY, ACCURACY, OR AVAILABILITY OF THE SERVICES. WITHOUT LIMITING THE FOREGOING, NEITHER COMPANY NOR ANYONE ASSOCIATED WITH COMPANY REPRESENTS OR WARRANTS THAT THE SERVICES, THEIR CONTENT, OR ANY SERVICES OR ITEMS OBTAINED THROUGH THE SERVICES WILL BE ACCURATE, RELIABLE, ERROR-FREE, OR UNINTERRUPTED, THAT DEFECTS WILL BE CORRECTED, THAT THE SERVICES OR THE SERVER THAT MAKES IT AVAILABLE ARE FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS OR THAT THE SERVICES OR ANY SERVICES OR ITEMS OBTAINED THROUGH THE SERVICES WILL OTHERWISE MEET YOUR NEEDS OR EXPECTATIONS.&lt;/p&gt;\r\n\r\n&lt;p&gt;COMPANY HEREBY DISCLAIMS ALL WARRANTIES OF ANY KIND, WHETHER EXPRESS OR IMPLIED, STATUTORY, OR OTHERWISE, INCLUDING BUT NOT LIMITED TO ANY WARRANTIES OF MERCHANTABILITY, NON-INFRINGEMENT, AND FITNESS FOR PARTICULAR PURPOSE.&lt;/p&gt;\r\n\r\n&lt;p&gt;THE FOREGOING DOES NOT AFFECT ANY WARRANTIES WHICH CANNOT BE EXCLUDED OR LIMITED UNDER APPLICABLE LAW.&lt;/p&gt;\r\n\r\n&lt;p&gt;20. Limitation Of Liability&lt;/p&gt;\r\n\r\n&lt;p&gt;EXCEPT AS PROHIBITED BY LAW, YOU WILL HOLD US AND OUR OFFICERS, DIRECTORS, EMPLOYEES, AND AGENTS HARMLESS FOR ANY INDIRECT, PUNITIVE, SPECIAL, INCIDENTAL, OR CONSEQUENTIAL DAMAGE, HOWEVER IT ARISES (INCLUDING ATTORNEYS&amp;rsquo; FEES AND ALL RELATED COSTS AND EXPENSES OF LITIGATION AND ARBITRATION, OR AT TRIAL OR ON APPEAL, IF ANY, WHETHER OR NOT LITIGATION OR ARBITRATION IS INSTITUTED), WHETHER IN AN ACTION OF CONTRACT, NEGLIGENCE, OR OTHER TORTIOUS ACTION, OR ARISING OUT OF OR IN CONNECTION WITH THIS AGREEMENT, INCLUDING WITHOUT LIMITATION ANY CLAIM FOR PERSONAL INJURY OR PROPERTY DAMAGE, ARISING FROM THIS AGREEMENT AND ANY VIOLATION BY YOU OF ANY FEDERAL, STATE, OR LOCAL LAWS, STATUTES, RULES, OR REGULATIONS, EVEN IF COMPANY HAS BEEN PREVIOUSLY ADVISED OF THE POSSIBILITY OF SUCH DAMAGE. EXCEPT AS PROHIBITED BY LAW, IF THERE IS LIABILITY FOUND ON THE PART OF COMPANY, IT WILL BE LIMITED TO THE AMOUNT PAID FOR THE PRODUCTS AND/OR SERVICES, AND UNDER NO CIRCUMSTANCES WILL THERE BE CONSEQUENTIAL OR PUNITIVE DAMAGES. SOME STATES DO NOT ALLOW THE EXCLUSION OR LIMITATION OF PUNITIVE, INCIDENTAL OR CONSEQUENTIAL DAMAGES, SO THE PRIOR LIMITATION OR EXCLUSION MAY NOT APPLY TO YOU.&lt;/p&gt;\r\n\r\n&lt;p&gt;21. Termination&lt;/p&gt;\r\n\r\n&lt;p&gt;We may terminate or suspend your account and bar access to Service immediately, without prior notice or liability, under our sole discretion, for any reason whatsoever and without limitation, including but not limited to a breach of Terms.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you wish to terminate your account, you may simply discontinue using Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;All provisions of Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.&lt;/p&gt;\r\n\r\n&lt;p&gt;22. Governing Law&lt;/p&gt;\r\n\r\n&lt;p&gt;These Terms shall be governed and construed in accordance with the laws of United States, which governing law applies to agreement without regard to its conflict of law provisions.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our failure to enforce any right or provision of these Terms will not be considered a waiver of those rights. If any provision of these Terms is held to be invalid or unenforceable by a court, the remaining provisions of these Terms will remain in effect. These Terms constitute the entire agreement between us regarding our Service and supersede and replace any prior agreements we might have had between us regarding Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;23. Changes To Service&lt;/p&gt;\r\n\r\n&lt;p&gt;We reserve the right to withdraw or amend our Service, and any service or material we provide via Service, in our sole discretion without notice. We will not be liable if for any reason all or any part of Service is unavailable at any time or for any period. From time to time, we may restrict access to some parts of Service, or the entire Service, to users, including registered users.&lt;/p&gt;\r\n\r\n&lt;p&gt;24. Amendments To Terms&lt;/p&gt;\r\n\r\n&lt;p&gt;We may amend Terms at any time by posting the amended terms on this site. It is your responsibility to review these Terms periodically.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your continued use of the Platform following the posting of revised Terms means that you accept and agree to the changes. You are expected to check this page frequently so you are aware of any changes, as they are binding on you.&lt;/p&gt;\r\n\r\n&lt;p&gt;By continuing to access or use our Service after any revisions become effective, you agree to be bound by the revised terms. If you do not agree to the new terms, you are no longer authorized to use Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;25. Waiver And Severability&lt;/p&gt;\r\n\r\n&lt;p&gt;No waiver by Company of any term or condition set forth in Terms shall be deemed a further or continuing waiver of such term or condition or a waiver of any other term or condition, and any failure of Company to assert a right or provision under Terms shall not constitute a waiver of such right or provision.&lt;/p&gt;\r\n\r\n&lt;p&gt;If any provision of Terms is held by a court or other tribunal of competent jurisdiction to be invalid, illegal or unenforceable for any reason, such provision shall be eliminated or limited to the minimum extent such that the remaining provisions of Terms will continue in full force and effect.&lt;/p&gt;\r\n\r\n&lt;p&gt;26. Acknowledgement&lt;/p&gt;\r\n\r\n&lt;p&gt;BY USING SERVICE OR OTHER SERVICES PROVIDED BY US, YOU ACKNOWLEDGE THAT YOU HAVE READ THESE TERMS OF SERVICE AND AGREE TO BE BOUND BY THEM.&lt;/p&gt;\r\n\r\n&lt;p&gt;27. Contact Us&lt;/p&gt;\r\n\r\n&lt;p&gt;Please send your feedback, comments, requests for technical support by email: admin@voyagergalactic.com.&lt;/p&gt;', '2022-02-28 13:41:02', '2022-02-28 13:41:02');
INSERT INTO `sp_options` (`id`, `name`, `value`, `created_at`, `updated_at`) VALUES
(61, 'privacy_policy', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;PRIVACY POLICY&lt;br /&gt;\r\nEffective date: 2021-05-12&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Introduction&lt;/p&gt;\r\n\r\n&lt;p&gt;Welcome to Voyagergalactic LLC.&lt;/p&gt;\r\n\r\n&lt;p&gt;Voyagergalactic LLC (&amp;ldquo;us&amp;rdquo;, &amp;ldquo;we&amp;rdquo;, or &amp;ldquo;our&amp;rdquo;) operates voyagergalactic.com (hereinafter referred to as &amp;ldquo;Service&amp;rdquo;).&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Privacy Policy governs your visit to voyagergalactic.com, and explains how we collect, safeguard and disclose information that results from your use of our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;We use your data to provide and improve Service. By using Service, you agree to the collection and use of information in accordance with this policy. Unless otherwise defined in this Privacy Policy, the terms used in this Privacy Policy have the same meanings as in our Terms and Conditions.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Terms and Conditions (&amp;ldquo;Terms&amp;rdquo;) govern all use of our Service and together with the Privacy Policy constitutes your agreement with us (&amp;ldquo;agreement&amp;rdquo;).&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Definitions&lt;/p&gt;\r\n\r\n&lt;p&gt;SERVICE means the voyagergalactic.com website operated by Voyagergalactic LLC.&lt;/p&gt;\r\n\r\n&lt;p&gt;PERSONAL DATA means data about a living individual who can be identified from those data (or from those and other information either in our possession or likely to come into our possession).&lt;/p&gt;\r\n\r\n&lt;p&gt;USAGE DATA is data collected automatically either generated by the use of Service or from Service infrastructure itself (for example, the duration of a page visit).&lt;/p&gt;\r\n\r\n&lt;p&gt;COOKIES are small files stored on your device (computer or mobile device).&lt;/p&gt;\r\n\r\n&lt;p&gt;DATA CONTROLLER means a natural or legal person who (either alone or jointly or in common with other persons) determines the purposes for which and the manner in which any personal data are, or are to be, processed. For the purpose of this Privacy Policy, we are a Data Controller of your data.&lt;/p&gt;\r\n\r\n&lt;p&gt;DATA PROCESSORS (OR SERVICE PROVIDERS) means any natural or legal person who processes the data on behalf of the Data Controller. We may use the services of various Service Providers in order to process your data more effectively.&lt;/p&gt;\r\n\r\n&lt;p&gt;DATA SUBJECT is any living individual who is the subject of Personal Data.&lt;/p&gt;\r\n\r\n&lt;p&gt;THE USER is the individual using our Service. The User corresponds to the Data Subject, who is the subject of Personal Data.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Information Collection and Use&lt;/p&gt;\r\n\r\n&lt;p&gt;We collect several different types of information for various purposes to provide and improve our Service to you.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Types of Data Collected&lt;/p&gt;\r\n\r\n&lt;p&gt;Personal Data&lt;/p&gt;\r\n\r\n&lt;p&gt;While using our Service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you (&amp;ldquo;Personal Data&amp;rdquo;). Personally identifiable information may include, but is not limited to:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. Email address&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. First name and last name&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. Phone number&lt;/p&gt;\r\n\r\n&lt;p&gt;0.4. Address, Country, State, Province, ZIP/Postal code, City&lt;/p&gt;\r\n\r\n&lt;p&gt;0.5. Cookies and Usage Data&lt;/p&gt;\r\n\r\n&lt;p&gt;We may use your Personal Data to contact you with newsletters, marketing or promotional materials and other information that may be of interest to you. You may opt out of receiving any, or all, of these communications from us by following the unsubscribe link.&lt;/p&gt;\r\n\r\n&lt;p&gt;Usage Data&lt;/p&gt;\r\n\r\n&lt;p&gt;We may also collect information that your browser sends whenever you visit our Service or when you access Service by or through any device (&amp;ldquo;Usage Data&amp;rdquo;).&lt;/p&gt;\r\n\r\n&lt;p&gt;This Usage Data may include information such as your computer&amp;rsquo;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that you visit, the time and date of your visit, the time spent on those pages, unique device identifiers and other diagnostic data.&lt;/p&gt;\r\n\r\n&lt;p&gt;When you access Service with a device, this Usage Data may include information such as the type of device you use, your device unique ID, the IP address of your device, your device operating system, the type of Internet browser you use, unique device identifiers and other diagnostic data.&lt;/p&gt;\r\n\r\n&lt;p&gt;Location Data&lt;/p&gt;\r\n\r\n&lt;p&gt;We may use and store information about your location if you give us permission to do so (&amp;ldquo;Location Data&amp;rdquo;). We use this data to provide features of our Service, to improve and customize our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;You can enable or disable location services when you use our Service at any time by way of your device settings.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tracking Cookies Data&lt;/p&gt;\r\n\r\n&lt;p&gt;We use cookies and similar tracking technologies to track the activity on our Service and we hold certain information.&lt;/p&gt;\r\n\r\n&lt;p&gt;Cookies are files with a small amount of data which may include an anonymous unique identifier. Cookies are sent to your browser from a website and stored on your device. Other tracking technologies are also used such as beacons, tags and scripts to collect and track information and to improve and analyze our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;Examples of Cookies we use:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. Session Cookies: We use Session Cookies to operate our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. Preference Cookies: We use Preference Cookies to remember your preferences and various settings.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. Security Cookies: We use Security Cookies for security purposes.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.4. Advertising Cookies: Advertising Cookies are used to serve you with advertisements that may be relevant to you and your interests.&lt;/p&gt;\r\n\r\n&lt;p&gt;Other Data&lt;/p&gt;\r\n\r\n&lt;p&gt;While using our Service, we may also collect the following information: sex, age, date of birth, place of birth, passport details, citizenship, registration at place of residence and actual address, telephone number (work, mobile), details of documents on education, qualification, professional training, employment agreements, NDA agreements, information on bonuses and compensation, information on marital status, family members, social security (or other taxpayer identification) number, office location and other data.&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Use of Data&lt;/p&gt;\r\n\r\n&lt;p&gt;Voyagergalactic LLC uses the collected data for various purposes:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. to provide and maintain our Service;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. to notify you about changes to our Service;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. to allow you to participate in interactive features of our Service when you choose to do so;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.4. to provide customer support;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.5. to gather analysis or valuable information so that we can improve our Service;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.6. to monitor the usage of our Service;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.7. to detect, prevent and address technical issues;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.8. to fulfil any other purpose for which you provide it;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.9. to carry out our obligations and enforce our rights arising from any contracts entered into between you and us, including for billing and collection;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.10. to provide you with notices about your account and/or subscription, including expiration and renewal notices, email-instructions, etc.;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.11. to provide you with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless you have opted not to receive such information;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.12. in any other way we may describe when you provide the information;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.13. for any other purpose with your consent.&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Retention of Data&lt;/p&gt;\r\n\r\n&lt;p&gt;We will retain your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.&lt;/p&gt;\r\n\r\n&lt;p&gt;We will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period, except when this data is used to strengthen the security or to improve the functionality of our Service, or we are legally obligated to retain this data for longer time periods.&lt;/p&gt;\r\n\r\n&lt;p&gt;7. Transfer of Data&lt;/p&gt;\r\n\r\n&lt;p&gt;Your information, including Personal Data, may be transferred to &amp;ndash; and maintained on &amp;ndash; computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ from those of your jurisdiction.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you are located outside United States and choose to provide information to us, please note that we transfer the data, including Personal Data, to United States and process it there.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.&lt;/p&gt;\r\n\r\n&lt;p&gt;Voyagergalactic LLC will take all the steps reasonably necessary to ensure that your data is treated securely and in accordance with this Privacy Policy and no transfer of your Personal Data will take place to an organisation or a country unless there are adequate controls in place including the security of your data and other personal information.&lt;/p&gt;\r\n\r\n&lt;p&gt;8. Disclosure of Data&lt;/p&gt;\r\n\r\n&lt;p&gt;We may disclose personal information that we collect, or you provide:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. Disclosure for Law Enforcement.&lt;/p&gt;\r\n\r\n&lt;p&gt;Under certain circumstances, we may be required to disclose your Personal Data if required to do so by law or in response to valid requests by public authorities.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. Business Transaction.&lt;/p&gt;\r\n\r\n&lt;p&gt;If we or our subsidiaries are involved in a merger, acquisition or asset sale, your Personal Data may be transferred.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. Other cases. We may disclose your information also:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3.1. to our subsidiaries and affiliates;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3.2. to contractors, service providers, and other third parties we use to support our business;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3.3. to fulfill the purpose for which you provide it;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3.4. for the purpose of including your company&amp;rsquo;s logo on our website;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3.5. for any other purpose disclosed by us when you provide the information;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3.6. with your consent in any other cases;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3.7. if we believe disclosure is necessary or appropriate to protect the rights, property, or safety of the Company, our customers, or others.&lt;/p&gt;\r\n\r\n&lt;p&gt;9. Security of Data&lt;/p&gt;\r\n\r\n&lt;p&gt;The security of your data is important to us but remember that no method of transmission over the Internet or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Data, we cannot guarantee its absolute security.&lt;/p&gt;\r\n\r\n&lt;p&gt;10. Your Data Protection Rights Under General Data Protection Regulation (GDPR)&lt;/p&gt;\r\n\r\n&lt;p&gt;If you are a resident of the European Union (EU) and European Economic Area (EEA), you have certain data protection rights, covered by GDPR.&lt;/p&gt;\r\n\r\n&lt;p&gt;We aim to take reasonable steps to allow you to correct, amend, delete, or limit the use of your Personal Data.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you wish to be informed what Personal Data we hold about you and if you want it to be removed from our systems, please email us at admin@voyagergalactic.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;In certain circumstances, you have the following data protection rights:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. the right to access, update or to delete the information we have on you;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. the right of rectification. You have the right to have your information rectified if that information is inaccurate or incomplete;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. the right to object. You have the right to object to our processing of your Personal Data;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.4. the right of restriction. You have the right to request that we restrict the processing of your personal information;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.5. the right to data portability. You have the right to be provided with a copy of your Personal Data in a structured, machine-readable and commonly used format;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.6. the right to withdraw consent. You also have the right to withdraw your consent at any time where we rely on your consent to process your personal information;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please note that we may ask you to verify your identity before responding to such requests. Please note, we may not able to provide Service without some necessary data.&lt;/p&gt;\r\n\r\n&lt;p&gt;You have the right to complain to a Data Protection Authority about our collection and use of your Personal Data. For more information, please contact your local data protection authority in the European Economic Area (EEA).&lt;/p&gt;\r\n\r\n&lt;p&gt;11. Your Data Protection Rights under the California Privacy Protection Act (CalOPPA)&lt;/p&gt;\r\n\r\n&lt;p&gt;CalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy. The law&amp;rsquo;s reach stretches well beyond California to require a person or company in the United States (and conceivable the world) that operates websites collecting personally identifiable information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals with whom it is being shared, and to comply with this policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;According to CalOPPA we agree to the following:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. users can visit our site anonymously;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. our Privacy Policy link includes the word &amp;ldquo;Privacy&amp;rdquo;, and can easily be found on the home page of our website;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. users will be notified of any privacy policy changes on our Privacy Policy Page;&lt;/p&gt;\r\n\r\n&lt;p&gt;0.4. users are able to change their personal information by emailing us at admin@voyagergalactic.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Policy on &amp;ldquo;Do Not Track&amp;rdquo; Signals:&lt;/p&gt;\r\n\r\n&lt;p&gt;We honor Do Not Track signals and do not track, plant cookies, or use advertising when a Do Not Track browser mechanism is in place. Do Not Track is a preference you can set in your web browser to inform websites that you do not want to be tracked.&lt;/p&gt;\r\n\r\n&lt;p&gt;You can enable or disable Do Not Track by visiting the Preferences or Settings page of your web browser.&lt;/p&gt;\r\n\r\n&lt;p&gt;12. Your Data Protection Rights under the California Consumer Privacy Act (CCPA)&lt;/p&gt;\r\n\r\n&lt;p&gt;If you are a California resident, you are entitled to learn what data we collect about you, ask to delete your data and not to sell (share) it. To exercise your data protection rights, you can make certain requests and ask us:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.1. What personal information we have about you. If you make this request, we will return to you:&lt;/p&gt;\r\n\r\n&lt;p&gt;0.0.1. The categories of personal information we have collected about you.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.0.2. The categories of sources from which we collect your personal information.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.0.3. The business or commercial purpose for collecting or selling your personal information.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.0.4. The categories of third parties with whom we share personal information.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.0.5. The specific pieces of personal information we have collected about you.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.0.6. A list of categories of personal information that we have sold, along with the category of any other company we sold it to. If we have not sold your personal information, we will inform you of that fact.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.0.7. A list of categories of personal information that we have disclosed for a business purpose, along with the category of any other company we shared it with.&lt;/p&gt;\r\n\r\n&lt;p&gt;Please note, you are entitled to ask us to provide you with this information up to two times in a rolling twelve-month period. When you make this request, the information provided may be limited to the personal information we collected about you in the previous 12 months.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.2. To delete your personal information. If you make this request, we will delete the personal information we hold about you as of the date of your request from our records and direct any service providers to do the same. In some cases, deletion may be accomplished through de-identification of the information. If you choose to delete your personal information, you may not be able to use certain functions that require your personal information to operate.&lt;/p&gt;\r\n\r\n&lt;p&gt;0.3. To stop selling your personal information. We don&amp;rsquo;t sell or rent your personal information to any third parties for any purpose. We do not sell your personal information for monetary consideration. However, under some circumstances, a transfer of personal information to a third party, or within our family of companies, without monetary consideration may be considered a &amp;ldquo;sale&amp;rdquo; under California law. You are the only owner of your Personal Data and can request disclosure or deletion at any time.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you submit a request to stop selling your personal information, we will stop making such transfers.&lt;/p&gt;\r\n\r\n&lt;p&gt;Please note, if you ask us to delete or stop selling your data, it may impact your experience with us, and you may not be able to participate in certain programs or membership services which require the usage of your personal information to function. But in no circumstances, we will discriminate against you for exercising your rights.&lt;/p&gt;\r\n\r\n&lt;p&gt;To exercise your California data protection rights described above, please send your request(s) by email: admin@voyagergalactic.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your data protection rights, described above, are covered by the CCPA, short for the California Consumer Privacy Act. To find out more, visit the official California Legislative Information website. The CCPA took effect on 01/01/2020.&lt;/p&gt;\r\n\r\n&lt;p&gt;13. Service Providers&lt;/p&gt;\r\n\r\n&lt;p&gt;We may employ third party companies and individuals to facilitate our Service (&amp;ldquo;Service Providers&amp;rdquo;), provide Service on our behalf, perform Service-related services or assist us in analysing how our Service is used.&lt;/p&gt;\r\n\r\n&lt;p&gt;These third parties have access to your Personal Data only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.&lt;/p&gt;\r\n\r\n&lt;p&gt;14. Analytics&lt;/p&gt;\r\n\r\n&lt;p&gt;We may use third-party Service Providers to monitor and analyze the use of our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;15. CI/CD tools&lt;/p&gt;\r\n\r\n&lt;p&gt;We may use third-party Service Providers to automate the development process of our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;16. Advertising&lt;/p&gt;\r\n\r\n&lt;p&gt;We may use third-party Service Providers to show advertisements to you to help support and maintain our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;17. Behavioral Remarketing&lt;/p&gt;\r\n\r\n&lt;p&gt;We may use remarketing services to advertise on third party websites to you after you visited our Service. We and our third-party vendors use cookies to inform, optimise and serve ads based on your past visits to our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;18. Payments&lt;/p&gt;\r\n\r\n&lt;p&gt;We may provide paid products and/or services within Service. In that case, we use third-party services for payment processing (e.g. payment processors).&lt;/p&gt;\r\n\r\n&lt;p&gt;We will not store or collect your payment card details. That information is provided directly to our third-party payment processors whose use of your personal information is governed by their Privacy Policy. These payment processors adhere to the standards set by PCI-DSS as managed by the PCI Security Standards Council, which is a joint effort of brands like Visa, Mastercard, American Express and Discover. PCI-DSS requirements help ensure the secure handling of payment information.&lt;/p&gt;\r\n\r\n&lt;p&gt;19. Links to Other Sites&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Service may contain links to other sites that are not operated by us. If you click a third party link, you will be directed to that third party&amp;rsquo;s site. We strongly advise you to review the Privacy Policy of every site you visit.&lt;/p&gt;\r\n\r\n&lt;p&gt;We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.&lt;/p&gt;\r\n\r\n&lt;p&gt;For example, the outlined privacy policy has been made using PolicyMaker.io, a free tool that helps create high-quality legal documents. PolicyMaker&amp;rsquo;s privacy policy generator is an easy-to-use tool for creating a privacy policy for blog, website, e-commerce store or mobile app.&lt;/p&gt;\r\n\r\n&lt;p&gt;20. Children&amp;rsquo;s Privacy&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Services are not intended for use by children under the age of 18 (&amp;ldquo;Child&amp;rdquo; or &amp;ldquo;Children&amp;rdquo;).&lt;/p&gt;\r\n\r\n&lt;p&gt;We do not knowingly collect personally identifiable information from Children under 18. If you become aware that a Child has provided us with Personal Data, please contact us. If we become aware that we have collected Personal Data from Children without verification of parental consent, we take steps to remove that information from our servers.&lt;/p&gt;\r\n\r\n&lt;p&gt;21. Changes to This Privacy Policy&lt;/p&gt;\r\n\r\n&lt;p&gt;We may update our Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.&lt;/p&gt;\r\n\r\n&lt;p&gt;We will let you know via email and/or a prominent notice on our Service, prior to the change becoming effective and update &amp;ldquo;effective date&amp;rdquo; at the top of this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.&lt;/p&gt;\r\n\r\n&lt;p&gt;22. Contact Us&lt;/p&gt;\r\n\r\n&lt;p&gt;If you have any questions about this Privacy Policy, please contact us by email: admin@voyagergalactic.com.&lt;/p&gt;', '2022-02-28 13:41:02', '2022-02-28 13:41:02'),
